/*	Example showing how to read grid layout information from tblColumns:

--	These are really the only fields you need in the tblColumns table.  It just gives you the captions to use.
SELECT	Caption,		--	This is the caption we use on the worklist grid for each field.
		DataField,		--	This is the match to each field in tblWorklistData, so wecan bind the query results to the column captions.
